isitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><!-- wp:paragraph -->\n<p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p>\n<!-- /wp:paragraph --></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:8888/onerentalatatime/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2023-03-15 18:29:58','2023-03-15 18:29:58','',2,'http://localhost:8888/onerentalatatime/?p=39',0,'revision','',0),(40,1,'2023-03-15 18:30:35','2023-03-15 18:30:35','','Favicon','','inherit','open','closed','','favicon','','','2023-03-15 18:30:35','2023-03-15 18:30:35','',0,'http://localhost:8888/onerentalatatime/wp-content/uploads/2023/03/Favicon.png',0,'attachment','image/png',0),(41,1,'2023-03-15 18:30:49','2023-03-15 18:30:49','http://localhost:8888/onerentalatatime/wp-content/uploads/2023/03/cropped-Favicon.png','cropped-Favicon.png','','inherit','open','closed','','cropped-favicon-png','','','2023-03-15 18:30:49','2023-03-15 18:30:49','',0,'http://localhost:8888/onerentalatatime/wp-content/uploads/2023/03/cropped-Favicon.png',0,'attachment','image/png',0),(47,1,'2023-03-15 18:44:47','